import logo from './lotus.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
      <img src={logo} alt="logo" style={{ width: '250px', height: '250px' }} /> {/* Adjust size as needed */}
        <h1>BetterBy.Science</h1>
      </header>
    </div>
  );
}

export default App;
